import React from 'react';
import logo from './logo.svg';
import './App.css';
import SignUpForm from './pages/SignUpForm';

function App() {
  return (
    <div className="App">
            <div className="App__Aside"></div>
             <div className="App__Form">
             <div className="PageSwitcher">
             <a href="#" activeClassName="PageSwitcher__Item--Active" className="PageSwitcher__Item" >Sign In</a>
            <a href="#"  activeClassName="PageSwitcher__Item--Active" className="PageSwitcher__Item">Sign Up</a>
            <div className="FormTitle">
                  <a href="#" activeClassName="FormTitle__Link--Active" className="FormTitle__Link">Sign In</a> or
                  <a href="#" activeClassName="FormTitle__Link--Active" className="FormTitle__Link">Sign Up</a>
              </div>
              <div className="FormTitle">
                 <SignUpForm></SignUpForm>
              </div>


      </div>
    </div>
    </div>
  );
}

export default App;
